import React from "react";
function Card(props) {
  return (
    <div class="col-lg-4">
      <div class="card">
        <img class="card-img-top" src={props.imgsr} alt={props.imgsr}></img>
        <div class="card-body">
          <h5 class="card-title">{props.title}</h5>
          <p class="card-text">{props.content}</p>
         <a href={props.insta}><i class="social-icon fa-brands fa-instagram fa-2xl"></i></a>
        </div>
      </div>
    </div>
  );
}
export default Card;
